import React, { useState } from "react";
import { Container } from 'react-bootstrap';
import { Row } from 'react-bootstrap';
import { Col } from 'react-bootstrap';
import { FaBars } from "react-icons/fa";

const Navbar  = () => {
    return (
       <header>
                <Container fluid className="nav">
                    <Row className="nav-row" fluid>
                        <Col className="col1">
                            <Logo /> 
                        </Col>
                        <Col className="col2">   
                            <Navigation />
                            <Hamburger />
                        </Col>
                    </Row>
                </Container>    
                <Stage />
       </header>
    )
}

const Navigation = () => {
return (
    <ul className="navigation-parent">
        <li className="nav-element" id="ueber"><a href="#ueber" className="nav-element">Über Uns</a></li>
        <li className="nav-element" id="mitgliedschaft"><a href="#mitgliedschaft" className="nav-element">Mitgliedschaft</a></li>
        <li className="nav-element" id="anfahrt"><a href="#anfahrt" className="nav-element">Anfahrt</a></li>
        <li className="nav-element" id="liga"><a href="#liga" className="nav-element">Liga</a></li>
        <li className="nav-element" id="kontakt"><a href="#kontakt" className="nav-element">Kontakt</a></li>
    </ul>
);
}

const Logo = () => {
return (
    <a className="logo-container ">
        <img className="img-fluid" src="././img/DFGP_Logo_nav.png" alt="DFGP Logo"></img>
    </a>
);
}

const Stage = () => {
return (
    <img className="img-fluid" src="././img/Teamfoto_buehne.jpg" alt="DFGP Team Foto vom ersten Spieltag"></img>
);
}

const Hamburger = () => {
    const [navbarOpen, setNavbarOpen] = useState(false);
    
    const handleToggle = () => {
        setNavbarOpen(!navbarOpen)
      }
      
    return (

<div class="topnav">
  <ul id="hamburger" className={`menuNav ${navbarOpen ? " showMenu" : ""}`}>
    <li><a href="#ueber">Über Uns</a></li>
    <li><a href="#mitgliedschaft">Mitgliedschaft</a></li>
    <li><a href="#anfahrt">Anfahrt</a></li>
    <li><a href="#liga">Liga</a></li>
    <li><a href="#kontakt">Kontakt</a></li>
  </ul>
  
  <button onClick={handleToggle}>
      {navbarOpen ? "style=color:red" : "Open"}
    <FaBars />
    </button>
</div>
    )
}

export default Navbar;
